import web3 from "./web3";
import Seller from "./build/contracts/Seller.json";

const instance = new web3.eth.Contract(
  Seller.abi,
  "0x5F4F9f9A4851Ffe1cA4bCC4389F076e947364ce0"
);
export default instance;
